def produce_audfile(file_name,file_data):
    '''
    根据传入的二进制数据，生成指定名称的可执行文件
    :param file_name: 待生成的文件名
    :param file_data: 文件的二进制数据
    :return:
    '''
    f = open(file_name,'wb')
    f.write(file_data)
    f.close()
